import { Link, Wrapper } from "./styles";

import Headroom from "react-headroom";
import React from "react";
import links from "./links";

export default () => {
	return (
		<Headroom>
			<Wrapper>
				<Logo />
				<LinkList>
					{links.map(({ title, href }) => (
						<Link to={href}>{title}</Link>
					))}
				</LinkList>
			</Wrapper>
		</Headroom>
	);
};
